import React from "react";

const quality = require("../assets/quality.png").default;

const Promise = () => {
  return (
    <div className="bg-light" style={styles.card}>
      <img style={styles.icon} src={quality} />
      <p>Highest Quality Standard</p>
    </div>
  );
};

const styles = {
  card: {
    width: 400,
    height: 450,
    margin: 20,
  },
  icon: {
    width: 40,
    textAlign: "center",
    justifyContent: "center",
    margin: 30,
  },
};

export default Promise;
